package com.onior.test;

import org.bouncycastle.pqc.crypto.mceliece.McElieceCipher;
import org.bouncycastle.pqc.crypto.mceliece.McEliecePublicKeyParameters;
import org.bouncycastle.pqc.jcajce.provider.mceliece.McElieceKeysToParams;

import java.security.KeyFactory;
import java.security.PublicKey;
import java.security.spec.X509EncodedKeySpec;

public class McElieceDemo {
    private static final String[] jsPub = {"",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            ""};

    public static void run() {
        try {
            X509EncodedKeySpec pubKeySpec = new X509EncodedKeySpec(Util.base64ToBytes(jsPub));
            KeyFactory KF = KeyFactory.getInstance("McEliece");
            PublicKey PK = KF.generatePublic(pubKeySpec);
            McEliecePublicKeyParameters GPKP = (McEliecePublicKeyParameters) McElieceKeysToParams.generatePublicKeyParameter(PK);
            McElieceCipher cipher = new McElieceCipher();
            cipher.init(true, GPKP);
        } catch (Exception e) {
            e.printStackTrace();
        }
    }
}
